]]></description>
										<content:encoded><![CDATA[<p>శ్రీ లలితే! నమోస్తుతే!</p>
<p>లలితాసహస్రనామల గొప్పదనం&#8230;! పారాయణ ఫలం సంపూర్ణం గా దక్కాలంటే ఎo చెయ్యలి, ఎలా చెయ్యలి&#8230;?</p>
<p>Sri Lalitae! Namostutae!</p>
